ground_truth:
function returnToNormalTax() external onlyOwner {
        sellMarketingFee = 1;
        sellLiquidityFee = 0;
        sellRedistributionFee = 0;
        sellBurnFee = 0;
        sellTotalFees = sellMarketingFee + sellLiquidityFee + sellRedistributionFee + sellBurnFee;
        require(sellTotalFees <= 30, "Keep fees at 30% or less");

        buyMarketingFee = 1;
        buyLiquidityFee = 0;
        buyRedistributionFee = 0;
        buyBurnFee = 0;
        buyTotalFees = buyMarketingFee + buyLiquidityFee + buyRedistributionFee + buyBurnFee;
        require(buyTotalFees <= 15, "Keep fees at 15% or less");
    }
